        "def plot_loss(history):\n",
        "    # Plot validation loss\n",
        "    plt.plot(history.history['val_loss'], label=\"Validation Loss\", color='DeepPink')\n",
        "\n",
        "    # Plot training loss\n",
        "    plt.plot(history.history['loss'], label=\"Training Loss\", color='Aqua')\n",
        "\n",
        "    # Set labels and title\n",
        "    plt.xlabel('Epoch')\n",
        "    plt.ylabel('Mean Absolute Error (MAE)')\n",
        "    plt.title('Training and Validation Loss Plot')\n",
        "\n",
        "    # Add legend\n",
        "    plt.legend()\n",
        "\n",
        "    # Show the plot\n",
        "    plt.show()\n",
        "\n",
        "plot_loss(history)"
